import React from "react";
import {　BrowserRouter as Router,　Switch,　Route} from "react-router-dom";
import Home from "./components/Home";
import Congrats from "./components/Congrats";
import Again from "./components/Again";
import './App.scss';

const error = [
  "第1問が不正解です。",
  "第2問が不正解です。",
  "第3問が不正解です。",
  "第4問が不正解です。"
]

function App(props) {
  return (
    <>
      <Router>
        <div>
          <Switch>
            <Route path="/congrats">
              <Congrats titlename="正解！" />
            </Route>
            <Route path="/again" component={Again}>
              <Again titlename="残念！" />
            </Route>
            <Route path="/">
              <Home titlename="ホーム" />
            </Route>
          </Switch>
        </div>
      </Router>
    </>
  );
}

export default App;
